final String imageUrl;

const Category ({
  required this.name,
  required this.imageUrl,
});


  @override
  List<Object?> get props => [name,imageUrl];

  static List<Category>categories=[
    Category(
        name: 'Army ',
        imageUrl: 'data:image/jpeg;base64,'
        ),
    Category(
        name: 'Animals',
        imageUrl: 'data:image/jpeg;base64,'
    ),
    Category(
        name: 'Forests',
        imageUrl: 'data:image/jpeg;base64,'
    ),
  ];
}